import * as React from 'react';
import { View, Text,Image} from 'react-native';
import { Button } from 'react-native-web';
import { Header,Container,Title,HeaderButtonLeft,HeaderButtonRight} from './styles';

export default function BluebarryPancakeScreen({navigation}) {
    return (
      <View style={{ flex: 1, alignItems:'center', justifyContent:'center' }}>
        <Image source={require('../BluebarryPancake/Vector.png')}/>
        <Text>Category</Text>
        <Button
          title="Go to Meal Schedule"
          onPress={() => navigation.navigate('Meal Schedule')}
        /> 
      </View>
    );
}
